export default class LoginMessage {
  static MESSAGE_DIALOG_INVALIDDATA =
    'Los datos no son correctos, por favor revísalos e intenta nuevamente.';
  static MESSAGE_DIALOG_SYSTEMERROR =
    'Lo sentimos, por ahora no está disponible la aplicación. Intenta más tarde.';
  static MESSAGE_DIALOG_WITHOUTCONNECTION =
    'No podemos detectar una conexión a internet en este momento. Revisa si tienes datos activados o estás conectado a una red wifi.';
}
